    false,nt"url": null,nt"notes": "<p>TOXMAPu00ae is a Geographic Information
    System (GIS) that uses maps of the United States and Canada to help users visually
    explore data primarily from the EPA's Toxics Release Inventory (TRI) and Superfund
    Program, as well as some non-EPA datasets. TOXMAP helps users create nationwide,
    regional, or local area maps showing where TRI chemicals are released on-site into
    the air, water, and ground. It also provides facility and release details, color-codes
    release amounts for a single year or year range, and aggregates release data over
    multiple years. Maps also show locations of Superfund National Priorities List (NPL)
    sites, listing all chemical contaminants present at these sites.  Two versions of
    TOXMAP are available: the classic version of TOXMAP released in 2004, and a new
    version of TOXMAP based on Adobeu00ae Flash/Flex technology.  The new version provides
    an improved map appearance and interactive capabilities and additional datasets
    such as EPA coal plant emissions data and U.S. commercial nuclear power plants.</p>n",nt"license_title":
